import React, { UseEffect } from "react";
import axios from "axios";

export default function ShowBrand() {
  UseEffect(() => {
    console.log("Call Branch API.");
  });
  axios
    .post("http://localhost:8080/show-brands")
    .then((result) => {
      console.log(result.data);
    })
    .catch((error) => {
      console.log(error);
    });
  return <div>showBrand</div>;
}
